      out.write("        /*~일째 랜덤한 숫자가 돌다가 멈추는 애니메이션*/\r\n");
      out.write("            function startRandomNumberAnimation() {\r\n");
      out.write("            const randomNumberElement = document.getElementsByClassName(\"randomNumber\");\r\n");
      out.write("            const targetNumber = 36; // 멈출 숫자\r\n");
      out.write("            const animationDuration = 300; // 애니메이션 지속 시간 (0.3초)\r\n");
      out.write("        \r\n");
      out.write("            let currentNumber = 0;\r\n");
      out.write("            let startTime;\r\n");
      out.write("        \r\n");
      out.write("            function updateNumber(timestamp) {\r\n");
      out.write("                if (!startTime) {\r\n");
      out.write("                    startTime = timestamp;\r\n");
      out.write("                }\r\n");
      out.write("        \r\n");
      out.write("                const progress = timestamp - startTime;\r\n");
      out.write("                const percentage = Math.min(1, progress / animationDuration);\r\n");
      out.write("        \r\n");
      out.write("                currentNumber = Math.round(percentage * targetNumber);\r\n");
      out.write("                randomNumberElement[0].textContent = currentNumber;\r\n");
      out.write("        \r\n");
      out.write("                if (percentage < 1) {\r\n");
      out.write("                    requestAnimationFrame(updateNumber);\r\n");
      out.write("                }\r\n");
      out.write("            }\r\n");
      out.write("        \r\n");
      out.write("            requestAnimationFrame(updateNumber);\r\n");
      out.write("        }\r\n");
